Liitokotka Liitokotka (Terathopius ecaudatus) on afrikkalainen kotka. Sisällysluettelo Koko ja ulkonäkö[muokkaa | muokkaa wikitekstiä] Linnun pituus on 80–85 cm, siipien kärkiväli 170–180 cm ja paino 2–3 kg. Kooltaan se on maakotkan luokkaa, mutta on hyvin lyhytpyrstöinen, pitkäsiipinen ja isopäinen. Vanhat linnut ovat kolmivärisiä: pääosa puvusta on musta, siivillä on laajat hopeanvalkoiset kuviot ja keskiselkä, koivet sekä nokka ja kalju naama ovat punertavat. Naaraan siivellä on enemmän ruske
..........
] Liitokotkille kelpaavat lähes kaikki maastotyypit niin autiomaista, metsistä, vuoristosta kuin ihmisasutuksen tuntumastakin. Vuoristossa niitä tavataan neljän kilometrin korkeudelle saakka. Niitä tavataan myös rannikoilla ja vesistöjen äärellä. Lisääntyminen[muokkaa | muokkaa wikitekstiä] Laji muodostaa elinikäisen parisuhteen. Pesä on puussa, usein lähellä tietä tai rautatietä, ja se on käytössä useita vuosia. Laji ei piittaa ihmisistä muuten kuin siinä tapauksessa, että pesäpuuhun kiivetään
